import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          <span className="logo-text">PrimeEstate</span>
          <span className="logo-dot">.</span>
        </Link>

        <div className={`navbar-links ${mobileMenuOpen ? 'active' : ''}`}>
          <Link to="/for-sale" className="nav-link">For Sale</Link>
          <Link to="/rental" className="nav-link">Rental</Link>
          <Link to="/accommodation" className="nav-link">Accommodation</Link>
          <Link to="/agents" className="nav-link">Agents</Link>
          <Link to="/blog" className="nav-link">Blog</Link>
          <Link to="/about-us" className="nav-link">About Us</Link>
          <Link to="/contact" className="nav-link">Contact</Link>

          {user ? (
            <div className="user-actions">
              <span className="welcome-text">Welcome, {user.name}</span>
              <Link to="/post-property" className="nav-button">Post Property</Link>
              <button onClick={handleLogout} className="nav-button logout">Logout</button>
            </div>
          ) : (
            <div className="auth-actions">
              <Link to="/login" className="nav-button">Login</Link>
              <Link to="/register" className="nav-button primary">Register</Link>
            </div>
          )}
        </div>

        <button 
          className="mobile-menu-button" 
          onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
        >
          {mobileMenuOpen ? '✕' : '☰'}
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
